import axios from "axios";
import { Card,Table, Container } from "react-bootstrap";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data

function Profiledoctor() {
    const doctorid = "01280904213";
    //#region to get data from DataBase NodeJs
    useEffect(() => {
        console.log("useEffect");
        axios.post("http://localhost:4000/doctorprofile", { doctorid: doctorid }, { withCredentials: true })
            .then(res => {
                console.log(res.data);
            }).catch(err => console.log(err));
    }, [])
    //#endregion
    return (
        <Container>
            <Card style={{ width: '50rem', flexDirection: 'row' }}>
                <Card.Img variant="top" src={process.env.PUBLIC_URL + '/dr1.jpg'} />
                <Card.Body>
                    <Card.Header>Personal </Card.Header>
                    <Table>
                        <tbody>
                            <tr>
                                <td>Dr.Name</td>
                                <td>AhmedAhmedAhmedAhmedAhmedAhmedAhmedv</td>
                            </tr>
                            <tr>
                                <td>Dr.Specialised</td>
                                <td>AhmedAhmedAhmedAhmedAhmedAhmedAhmed</td>
                            </tr>
                            <tr>
                                <td>Dr.Home Work</td>
                                <td>rrrr</td>
                            </tr>
                        </tbody>
                    </Table>
                </Card.Body>
            </Card>
        </Container>
    )
}

export default Profiledoctor;
